import React from "react";

const App = () => {
  return (
    <div class="container flex flex-col">
      <div class="grid grid-cols-6 gap-5">
        <div class="flex flex-col gap-3 bg-white p-3 rounded-xl">
          <div class="h-32 w-full rounded-xl bg-sky-400"></div>

          <span>Sample Item</span>
          <span>PHP 1000.00</span>

          <span class="bg-sky-400 w-32 px-3 py-1 rounded-xl text-center select-none cursor-pointer text-white font-semibold">
            Add to Cart
          </span>
        </div>
      </div>
    </div>
  );
};

export default App;
